import React from 'react'
import FooterImg from '../assets/footer.webp'
import styled from 'styled-components'

const Container = styled.footer`
    width: 100%;
    height: 50vh;

    &:before{
        background: url(${FooterImg});
        background-size: 100% 1200px;
        bottom: 0;
        content: "";
        height: 100%;
        left: 0;
        position: absolute;
        width: 100%;
        z-index: -2;
    }
`

function Footer() {
  return (
    <Container>

    </Container>
  )
}

export default Footer
